window.bookSummaryJSON = "A simple double-date night goes horrifyingly wrong for four teenagers when they take a detour to \"Bubblehead Road.\" When the two boyfriends of the group decide to fulfill a dare by visiting a legendary haunted village in the woods, they find both the monsters that they're looking for and the monsters inside themselves. \"Bubblehead Road,\" a horror story which explores how, in a certain light, we can all appear terrifying, can be found in the collection <i>Certain Dark Things</i>, also available on Audible.com."; 
